import React, { useState } from "react";
import { Link, Box, Typography, Dialog, Card, CardMedia } from "@mui/material";

type Props = {
  id: number;
  image: string;
  sizePer: number;
};
const ImageDialog = (Props) => {
  /** 画面パラメータ */
  const [dialogOpenF, setDialogOpenF] = useState(false);

  /**
   * コンポーネントに渡す引数
   */
  const compProps = {
    bookShowDialog: {
      open: dialogOpenF, //ダイアログの表示プローアティ
      bookParam: props.bookParam,
      onClose: () => setDialogOpenF(false), //ダイアログ非表示処理
    },
    showLink: {
      href: "#",
      onClick: () => setDialogOpenF(true), //ダイアログ表示処理
    },
  };

  return (
    <Box>
      <img alt={props.id} src={props.image} />
      {/* 画像の表示 */}
      <Link {...compProps.showLink}>
        <Card>
          <CardMedia
            component="img"
            image={props.image}
            title={"スケジュール" + props.bookParam.id}
            style={{ maxWidth: props.bookParam.sizePer + "%" }}
          />
        </Card>
      </Link>
      {/* ダイアログの表示 */}
      <Dialog {...compProps.bookShowDialog} />
    </Box>
  );
};

export default ImageDialog;
